script: |
  super -f text -I q3519.spq | sort > q3519.out

inputs:
  - name: q3519.spq
    data: |
      SELECT DISTINCT - + col2, 84 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE + col2 * - + col1 <> + ( - col0 );
  - name: tab0

outputs:
  - name: q3519.out
    data: |
      -10	84
      -47	84
      -99	84
